import { NavLink } from "react-router-dom"
import styles from "../styles/Navbar.css"

const Navbar = () => {

    function isLinkActive (isActive) {
        return isActive ? styles.activeLink : styles.nonactiveLink
    }

    return(
        <div className={styles.Navbar}>
            <nav>
                <NavLink to="/" className={ ({isActive}) => isLinkActive(isActive)}>Schedule</NavLink>
                <NavLink to="/standings" className={ ({isActive}) => isLinkActive(isActive)}>Standings</NavLink>
                <NavLink to="/results" className={ ({isActive}) => isLinkActive(isActive)}>Results</NavLink>
            </nav>
        </div>
    )
}

export default Navbar
